# Найдите все повторяющиеся последовательности из трёх цифр, которые идут друг за другом.

# Sample Input 1:
# 696696 878878

# Sample Output 1:
# 696696 878878

# Sample Input 2:
# 534535345377777753453

# Sample Output 2:
# 777777

# Sample Input 3:
# 

# Sample Output 3:
# 000000 100100 200200 300300 400400 500500 600600 700700 800800 900900 010010 110110 210210 310310 410410 510510 610610


import re
res = re.findall(r'(\d{3})(\1)', input())
print(*list(map(''.join, res)))